import React, { useState, useEffect } from 'react';
import { StatusBar, StyleSheet, Text, View, Button, TextInput, Modal, TouchableOpacity, Alert } from 'react-native';
import { printToFileAsync } from 'expo-print';
import { shareAsync } from 'expo-sharing';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { API_URL } from './config';
import axios from 'axios';
import { useNavigation } from '@react-navigation/native';
import colors from './colors';
import { Ionicons } from '@expo/vector-icons';

const Factura = ({ isVisible, onClose, selectedLocation }) => {
  const [rfc, setRFC] = useState("");
  const [meats, setMeats] = useState([]);
  const [meatsName, setMeatsName] = useState({});
  const [meatsExtraName, setMeatsExtraName] = useState({});
  const [carnePrecioFijo, setCarnePrecioFijo] = useState(0);
  const [totalPrice, setTotalPrice] = useState(0);
  const [isModalVisible, setIsModalVisible] = useState(false);
  const navigation = useNavigation();
  const preEnv = 35;

  const closeModal = () => {
    setIsModalVisible(false);
  };

  const confirmLocationAndGeneratePdf = async () => {
    if (selectedLocation) {
      const { latitude, longitude } = selectedLocation;
      const idCarShop = await AsyncStorage.getItem('idCarShop');

      const body = JSON.stringify({
        latitue: latitude,
        longitude: longitude,
        idCarShop: idCarShop
      });

      try {
        const token = await AsyncStorage.getItem('token');
        const response = await fetch(`${API_URL}/api/order/add`, {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
            Authorization: token
          },
          body: body
        });
        const data = await response.json();
        Alert.alert('Pedido en curso', 'Puedes ver tu pedido en el historial.');

        generatePdf();
        navigation.navigate('Index');
        onClose();

      } catch (error) {
        console.error('Error al enviar los datos:', error);
        Alert.alert('Error', 'Hubo un error al enviar los datos.');
      }
    } else {
      Alert.alert('Error', 'Por favor, selecciona una ubicación en el mapa antes de generar la factura.');
    }
  };

  useEffect(() => {
    // Función para obtener datos del carrito
    const fetchData = async () => {
      try {
        const token = await AsyncStorage.getItem('token');
        const id = await AsyncStorage.getItem('idCarShop');

        const url = `${API_URL}/api/cardsitems/readForShop`;

        const response = await axios.post(url, { id: id }, {
          headers: {
            'Content-Type': 'application/json',
            Authorization: token,
          }
        });

        setMeats(response.data.data);

        if (response.data.data.length > 0) {
          response.data.data.forEach(item => {
            const productExtras = item.productExtrasDto;
            const extraName = productExtras.extraDto.name;
            const productName = productExtras.productDto.name;

            setMeatsName(prevState => ({ ...prevState, [item.id]: { name: productName } }));
            setMeatsExtraName(prevState => ({ ...prevState, [item.id]: { name: extraName } }));
          });
        }

        fetchCarnePrecioFijo();

      } catch (error) {
        console.error('Error al obtener los datos del carrito:', error);
      }
    };

    fetchData();
  }, []);

  const fetchCarnePrecioFijo = async () => {
    try {
      const response = await axios.get(`${API_URL}/api/priceKg/readNow`);
      setCarnePrecioFijo(response.data.data.priceSale);
    } catch (error) {
      console.error('Error al obtener el precio fijo de la carne:', error);
    }
  };

  useEffect(() => {
    const totalPriceSum = meats.reduce((acc, meat) => {
      const extraPrice = meat.productExtrasDto.extraDto.price || 0;
      const quantity = meat.quantity || 0;
      const itemPrice = (carnePrecioFijo + extraPrice) * quantity;
      return acc + itemPrice;
    }, 0);
    setTotalPrice(totalPriceSum);
  }, [meats, carnePrecioFijo]);


  const generatePdf = async () => {
    try {
      const html = `
  <html lang="en">
  <head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>SWIFCUT Factura</title>
    <style>
      body {
        font-family: Arial, sans-serif;
        margin: 0;
        padding: 20px;
      }
  
      header {
        display: flex;
        justify-content: space-between;
        align-items: center;
        margin-bottom: 20px;
        text-color: black;
      }
  
      .logo img {
        background-color: #FFFFFF;
        max-width: 100px;

      }
  
      .contact-info p {
        margin: 5px 0;
      }
  
      main {
        background-color: #FFFFFF;
        padding: 20px;
        border-radius: 5px;
      }
  
      h1 {
        text-align: left;
        margin-bottom: 20px;
      }
  
      .client-info {
        float: right;
        width: 50%;
        text-align: right;
        
      }
  
      .invoice-info {
        float: left;
        width: 50%;
      }
  
  
      table {
        width: 100%;
        border-collapse: collapse;
        margin-bottom: 20px;
      }
  
      th, td {
        padding: 10px;
        text-align: left;
        border-bottom: 1px solid #ddd;
      }
  
      .totals {
        margin-bottom: 20px;
      }
  
      .terms h3 {
        margin-bottom: 10px;
      }
  
      footer .logo {
        margin-top: 10px;
        display: flex;
        align-items: center;
        float: right; 
      }
  
      footer .contact-info p {
        margin: 5px;
      }
    </style>
  </head>
  <body>
    <header>
      <div class="logo">
      <svg width="600" height="150" viewBox="0 0 1197 208" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
        <rect width="1197" height="208" fill="url(#pattern0_201_10)"/>
        <defs>
        <pattern id="pattern0_201_10" patternContentUnits="objectBoundingBox" width="1" height="1">
        <use xlink:href="#image0_201_10" transform="scale(0.000835422 0.00480769)"/>
        </pattern>
        <image id="image0_201_10" width="1100" height="200" xlink:href="data:image/jpeg;base64,"/>
        </defs>
        </svg>
      </div>
      <div class="contact-info">
        <p>www.SWIFTCUT.com</p>
        <p>swiftcut@gmail.com</p>
        <p>Morelos 66214</p>
        <p>Tel: 913-538-0999</p>
      </div>
    </header>
  
    <main>
      <h1>Factura</h1>
      <div class="invoice-info">
        <p>Cantidad debida: $${(totalPrice + preEnv).toFixed(2)}</p>
      </div>
  
      <div class="client-info">
        <P>RFC del cliente: ${rfc}</P>
        <p>Direccion: Paseos de las arboleadas #11</p>
        <p>Numero de telefono: 7771429870</p>
      </div>
  
      <table class="product-table">
      <thead>
        <tr>
          <th>Descripción de productos</th>
          <th>Precio unitario</th>
          <th>Cantidad</th>
          <th>Precio total</th>
        </tr>
      </thead>
      <tbody class="data">
        ${meats.map((meat, index) => `
          <tr key=${index}>
            <td>${meatsName[meat.id].name} - ${meatsExtraName[meat.id].name}</td>
            <td>$${(carnePrecioFijo + meat.productExtrasDto.extraDto.price).toFixed(2)}</td>
            <td>${meat.quantity}</td>
            <td>$${((carnePrecioFijo + meat.productExtrasDto.extraDto.price) * meat.quantity).toFixed(2)}</td>
          </tr>
        `).join('')}
      </tbody>
    </table>
    <table class="totals">
      <tr>
        <td>Total:</td>
        <td>$${totalPrice.toFixed(2)}</td>
      </tr>
      <tr>
        <td>Total con envio:</td>
        <td>$${(totalPrice + preEnv).toFixed(2)}</td>
      </tr>
    </table>  
      <div class="terms">
        <h3>Terminos y Condiciones</h3>
        <p>El saldo adeudado se paga en 14 días a partir de la fecha de esta factura.</p>
        <p>Metodo de pago:</p>
        <p>PayPal: 123456@gmail.com</p>
        <p>Numero de  cuenta: 1123-112234-3345665543</p>
      </div>

      <footer>
      <div class="logo">
      <svg width="100" height="35" viewBox="0 0 1197 208" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
        <rect width="1197" height="208" fill="url(#pattern0_201_10)"/>
        <defs>
        <pattern id="pattern0_201_10" patternContentUnits="objectBoundingBox" width="1" height="1">
        <use xlink:href="#image0_201_10" transform="scale(0.000835422 0.00480769)"/>
        </pattern>
        <image id="image0_201_10" width="110" height="20" xlink:href="data:image/jpeg;base64,"/>
        </defs>
        </svg>
      </div>
    </footer>
    </main>
  </body>
  </html>
  
  `;

      const file = await printToFileAsync({
        html: html,
        base64: false
      });

      // Compartir el PDF
      await shareAsync(file.uri);

    } catch (error) {
      console.error('Error al generar o compartir el PDF:', error);
    }
  };

  return (
    <Modal
      visible={isVisible}
      transparent={true}
      animationType="slide"
      onRequestClose={onClose}
    >
      <View style={styles.modalContainer}>
        <View style={styles.modalContent}>
          <TouchableOpacity style={styles.closeButton} onPress={onClose}>
            <Ionicons name="close-circle" size={24} color={colors.red3} />
          </TouchableOpacity>
          <View style={styles.container}>
            <Text style={{ marginBottom: 5, color: colors.grey }}>Ingresa tu RFC:</Text>
            <TextInput
              value={rfc}
              style={styles.textInput}
              onChangeText={(value) => setRFC(value)}
            />
            <View>
              <TouchableOpacity style={styles.modalButton} onPress={confirmLocationAndGeneratePdf}>
                <Text style={styles.modalButtonText}>Generar PDF</Text>
              </TouchableOpacity>
            </View>
            <StatusBar style="auto" />
          </View>
        </View>
      </View>
    </Modal>
  );
}

const styles = StyleSheet.create({
  modalContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: 'rgba(0, 0, 0, 0.5)',
  },
  modalContent: {
    backgroundColor: 'white',
    borderRadius: 10,
    paddingHorizontal: 20,
    paddingVertical: 30,
    alignItems: 'center',
  },
  closeButton: {
    alignSelf: 'flex-end',
    padding: 10,
  },
  container: {
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
    paddingHorizontal: 20,
    paddingVertical: 40,
  },
  textInput: {
    width: '100%',
    height: 40,
    borderColor: 'gray',
    borderWidth: 1,
    paddingHorizontal: 20,
    marginBottom: 20,
    borderRadius: 25,
  },
  modalContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: 'rgba(0, 0, 0, 0.5)',
  },
  modalContent: {
    backgroundColor: 'white',
    borderRadius: 10,
    paddingHorizontal: 45,
    paddingVertical: 5,
    alignItems: 'center',
  },
  modalTitle: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 20,
    textAlign: 'center',
  },
  modalText: {
    fontSize: 18,
    marginBottom: 20,
  },
  modalButton: {
    backgroundColor: colors.red3,
    borderRadius: 10,
    paddingVertical: 10,
    paddingHorizontal: 20,
    marginHorizontal: 15,
    marginTop: 15,
  },
  modalButtonText: {
    color: 'white',
    fontWeight: 'bold',
  },
  closeButton: {
    position: 'absolute',
    top: 10,
    right: 10,
    backgroundColor: 'transparent',
    padding: 5,
  },
});

export default Factura;
